import React, { Component } from 'react'
import './App.css'
// import Header from '../Header/Header'

class App extends Component {
  constructor() {
    super()
    this.state={
      bookLists: [],
      error: false
    }
  }

  componentDidMount = () => {
    fetchBookData()
    .then((data) => {
      this.setState({ bookLists: data.results.lists })
    })
  }

  render() {
    return (
      <h1>Hello World</h1>
    )
  }
}

export default App;
